import React from 'react'
import Search from './Search'
import { withCharacter } from './MyProvider'

const allInfoContainer = () => {
    const mappedinfo = this.props.allInfo.map(info => <Search spellName={info.spell}>{info.spellName}</Search>)

    return(
        <div>
            {mappedinfo}
        </div>
    )
}

export default withCharacter(allInfoContainer)
